<h3 data-start="62" data-end="108" class="">📌 <strong data-start="69" data-end="108">Co dokładnie robi ten skrypt teraz?</strong></h3>
<p data-start="110" data-end="159" class="">✅ <strong data-start="112" data-end="159">Tak, tworzy plik z kliknięciami klawiatury:</strong></p>
<ul data-start="161" data-end="422">
<li data-start="161" data-end="273" class="" style="">
<p data-start="163" data-end="273" class="">Plik o nazwie <code data-start="177" data-end="192">keylogger.txt</code> w folderze <code data-start="204" data-end="215">%APPDATA%</code> (np. <code data-start="221" data-end="272">C:\Users\TwojaNazwa\AppData\Roaming\keylogger.txt</code>)</p>
</li>
<li data-start="274" data-end="353" class="" style="">
<p data-start="276" data-end="353" class="">Każde kliknięcie klawisza jest zapisywane (np. <code data-start="323" data-end="346">A B C Backspace Enter</code>, itd.)</p>
</li>
<li data-start="354" data-end="422" class="" style="">
<p data-start="356" data-end="422" class="">Po osiągnięciu bufora 50 znaków → dane są dopisywane do tego pliku</p>
</li>
