<h3 data-start="691" data-end="718" class="">🔁 Co się dzieje dalej?</h3>
<p data-start="720" data-end="738" class="">Po każdej wysyłce:</p>
<ul data-start="739" data-end="828">
<li data-start="739" data-end="828" class="" style="">
<p data-start="741" data-end="828" class="">Plik jest czyszczony (<code data-start="763" data-end="778">Clear-Content</code>), więc następna wiadomość zawiera tylko nowe dane</p>
</li>
</ul>
<p data-start="830" data-end="844" class="">Po 5 minutach:</p>
<ul data-start="845" data-end="894">
<li data-start="845" data-end="872" class="" style="">
<p data-start="847" data-end="872" class="">Wysyłany jest ostatni log</p>
</li>
<li data-start="873" data-end="894" class="" style="">
<p data-start="875" data-end="894" class="">Wszystko się zamyka</p>
</li>
</ul>
