<h3 data-start="901" data-end="1015" class="">🔄 <strong data-start="908" data-end="1015">Czy chcesz, żeby zamiast wysyłać tekst, skrypt wysłał prawdziwy plik <code data-start="979" data-end="985">.txt</code> jako załącznik do Discorda?</strong></h3>
